import { BrowserRouter, Routes, Route } from "react-router-dom";
import LandingPage from "./pages/LandingPage";
const Router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<LandingPage />} />
        <Route exact path="/notfound" element={<LandingPage />} />
        <Route exact path="/" element={<LandingPage />} />
        <Route exact path="/" element={<LandingPage />} />

      </Routes>
    </BrowserRouter>
  );
};

export default Router;
